/* FreeRTOS.org includes. */
#include "FreeRTOS.h"
#include "task.h"
#include <stdatomic.h>

/* Demo includes. */
#include "basic_io.h"

/* The task function. */
void vTaskFunction( void *pvParameters );

/* A variable that is incremented by the idle task hook function. */
/* default: 1 */
#if 1
  /* non atomic - default */
  static unsigned long ulIdleCycleCount = 0UL;
  int GlobalVar;
#else
  /* atomic */
  static atomic_ulong ulIdleCycleCount = 0UL;
  atomic_int GlobalVar;
#endif

/* Define the strings that will be passed in as the task parameters.  These are
defined const and off the stack to ensure they remain valid when the tasks are
executing. */
const char *pcTextForTask1 = "Task 1 is running, ulIdleCycleCount = ";
const char *pcTextForTask2 = "Task 2 is running, ulIdleCycleCount = ";

/*-----------------------------------------------------------*/

int main( void )
{
	GlobalVar |= 0x01;
	/* Create the first task at priority 1... */
	xTaskCreate( vTaskFunction, "Task 1", 240, (void*)pcTextForTask1, 1, NULL );

	/* ... and the second task at priority 2.  The priority is the second to
	last parameter. */
	xTaskCreate( vTaskFunction, "Task 2", 240, (void*)pcTextForTask2, 2, NULL );

	/* Start the scheduler so our tasks start executing. */
	vTaskStartScheduler();

	for( ;; );
	return 0;
}
/*-----------------------------------------------------------*/

void vTaskFunction( void *pvParameters )
{
char *pcTaskName;

	/* The string to print out is passed in via the parameter.  Cast this to a
	character pointer. */
	pcTaskName = ( char * ) pvParameters;

	/* As per most tasks, this task is implemented in an infinite loop. */
	for( ;; )
	{
		/* Print out the name of this task AND the number of times ulIdleCycleCount
        has been incremented. */
		vPrintStringAndNumber( pcTaskName, ulIdleCycleCount );

		/* Delay for a period.  This time we use a call to vTaskDelay() which
		puts the task into the Blocked state until the delay period has expired.
		The delay period is specified in 'ticks'. */
		vTaskDelay( 250 / portTICK_RATE_MS );
	}
}
/*-----------------------------------------------------------*/

/* Idle hook functions MUST be called vApplicationIdleHook(), take no parameters,
and return void. */
void vApplicationIdleHook( void )
{
	/* This hook function does nothing but increment a counter. */
	ulIdleCycleCount++;
}
/*-----------------------------------------------------------*/

void vApplicationMallocFailedHook( void )
{
	/* This function will only be called if an API call to create a task, queue
	or semaphore fails because there is too little heap RAM remaining. */
	for( ;; );
}
/*-----------------------------------------------------------*/

void vApplicationStackOverflowHook( TaskHandle_t pxTask, char *pcTaskName )
{
	/* This function will only be called if a task overflows its stack.  Note
	that stack overflow checking does slow down the context switch
	implementation. */
	for( ;; );
}
/*-----------------------------------------------------------*/

void vApplicationTickHook( void )
{
	/* This example does not use the tick hook to perform any processing. */
}

interface GoAffProAffiliate {
    id: number;
    email: string;
    ref_code: string;
    status: string;
    created_at: string;
    updated_at: string;
}

interface CreateAffiliateRequest {
    email: string;
    first_name?: string;
    last_name?: string;
    name: string;
    password: string;
}

interface CreateAffiliateResponse {
    success: boolean;
    affiliate: GoAffProAffiliate | null;
    message?: string;
    errors?: Record<string, string[]>;
}

/**
 * Helper function to update an affiliate via PATCH
 */
async function updateGoAffProAffiliate(
    id: number,
    body: Record<string, unknown>,
): Promise<{ success: boolean; data?: unknown; error?: string }> {
    try {
        const response = await fetch(
            `${serverConfig.goaffproApiUrl}/admin/affiliates/${id}`,
            {
                method: "PATCH",
                headers: {
                    "Content-Type": "application/json",
                    "x-goaffpro-access-token": serverConfig.goaffproApiKey,
                },
                body: JSON.stringify(body),
            },
        );

        const responseData = await response.json();

        if (!response.ok) {
            return {
                success: false,
                error: responseData.error || responseData.message ||
                    "Failed to update affiliate",
            };
        }

        return {
            success: true,
            data: responseData,
        };
    } catch (error) {
        console.error("Error updating GoAffPro affiliate:", error);

        return {
            success: false,
            error: "Internal server error",
        };
    }
}

/**
 * Create a new affiliate in GoAffPro
 */
export async function createGoAffProAffiliate(
    affiliateData: CreateAffiliateRequest,
): Promise<CreateAffiliateResponse> {
    console.log("affiliateData", affiliateData);
    try {
        const response = await fetch(
            `${serverConfig.goaffproApiUrl}/admin/affiliates`,
            {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                    "x-goaffpro-access-token": serverConfig.goaffproApiKey,
                },
                body: JSON.stringify({
                    email: affiliateData.email,
                    name: affiliateData.name,
                    password: affiliateData.password,
                    password_expired: true,
                    status: "pending",
                    first_name: affiliateData.first_name,
                    last_name: affiliateData.last_name,
                }),
            },
        );

        const responseData = await response.json();

        if (!response.ok) {
            console.error("Error creating GoAffPro affiliate:", responseData);
            return {
                success: false,
                affiliate: null,
                message: responseData.error || "Failed to create affiliate",
                errors: responseData.errors,
            };
        }

        // Get the affiliate ID from the response
        const createdAffiliateId = responseData.affiliate_id;

        // Update name fields immediately after creation
        // This is necessary because the creation endpoint doesn't always persist these fields
        if (
            createdAffiliateId &&
            (affiliateData.name || affiliateData.first_name ||
                affiliateData.last_name)
        ) {
            const updateResult = await updateGoAffProAffiliate(
                createdAffiliateId,
                {
                    ...(affiliateData.name && { name: affiliateData.name }),
                    ...(affiliateData.first_name &&
                        { first_name: affiliateData.first_name }),
                    ...(affiliateData.last_name &&
                        { last_name: affiliateData.last_name }),
                },
            );

            if (!updateResult.success) {
                console.warn(
                    "Failed to update affiliate name fields:",
                    updateResult.error,
                );
                // Don't fail the entire creation if update fails
            }
        }

        const affiliate = await getGoAffProAffiliateByEmail(
            affiliateData.email,
        );

        return {
            success: true,
            affiliate: affiliate,
            message: "Affiliate created successfully",
        };
    } catch (error) {
        console.error("Error creating GoAffPro affiliate:", error);
        return {
            success: false,
            affiliate: null,
            message: "Internal server error",
        };
    }
}

/**
 * Approve affiliate by id from GoAffPro
 */
export async function approveGoAffProAffiliate(
    id: number,
): Promise<
    { success: boolean; message?: string; error?: string; id?: number }
> {
    try {
        const updateResult = await updateGoAffProAffiliate(id, {
            status: "approved",
            first_name: "David",
            last_name: "Baker",
        });

        if (!updateResult.success) {
            return {
                success: false,
                message: updateResult.error ||
                    "Failed to approve affiliate in GoAffPro",
            };
        }

        const responseData = updateResult.data as {
            affiliate?: string | Record<string, unknown>;
            updated?: boolean;
            id?: number;
        };

        // Parse affiliate if it's a JSON string
        const affiliate = typeof responseData.affiliate === "string"
            ? JSON.parse(responseData.affiliate)
            : responseData.affiliate;

        const success = affiliate?.status === "approved" &&
            responseData.updated === true &&
            responseData.id != null;

        console.log("success", success);
        console.log("responseData", responseData);
        console.log("parsed affiliate", affiliate);

        if (!success) {
            return {
                success: false,
                message: "Failed to approve affiliate in GoAffPro",
            };
        }

        return {
            success: true,
            message: "Affiliate approved successfully",
            id: responseData.id,
        };
    } catch (error) {
        console.error("Error approving GoAffPro affiliate:", error);
        return { success: false, message: "Internal server error" };
    }
}

#include <ESP8266WiFi.h>
#include <WiFiUdp.h>
#include <NTPClient.h>
#include <ESP8266WebServer.h>

#define RELAY_PIN D1
#define LDR_PIN   A0

// ===== Wi-Fi Credentials =====
const char* ssid = "TestESP";
const char* password = "12345678";

// ===== Settings =====
int threshold = 600;      // Default LDR threshold
int startHour = 18, startMinute = 0, startSecond = 0;
int endHour   = 6,  endMinute = 0, endSecond = 0;

WiFiUDP ntpUDP;
NTPClient timeClient(ntpUDP, "pool.ntp.org", 19800, 60000); // +5:30 offset (India)
ESP8266WebServer server(80);

bool manualOverride = false;
bool manualState = false;

void handleRoot() {
  int ldrValue = analogRead(LDR_PIN);
  timeClient.update();
  int hourNow = timeClient.getHours();

  bool dark = (ldrValue < threshold);
  bool night = (hourNow >= startHour || hourNow < endHour);
  bool autoState = (dark || night);
  bool lightOn = manualOverride ? manualState : autoState;

  String html = R"rawliteral(
  <!DOCTYPE html><html><head>
  <meta name='viewport' content='width=device-width, initial-scale=1'>
  <title>Smart Auto Light</title>
  <style>
  body{margin:0;font-family:Poppins,Arial;background:#111;color:#fff;text-align:center;}
  .container{max-width:400px;margin:auto;padding:20px;}
  input,button{width:90%;padding:10px;margin:8px 0;border:none;border-radius:10px;font-size:16px;}
  button{cursor:pointer;}
  .on{background:#4caf50;color:white;}
  .off{background:#f44336;color:white;}
  .switch{background:#2196f3;color:white;}
  .card{background:#222;border-radius:15px;padding:15px;margin:10px 0;}
  </style></head><body>
  <div class='container'>
  <h2>üåô Smart Auto Light</h2>
  <div class='card'>
    <b>LDR Value:</b> <span id='ldr'>)rawliteral" + String(ldrValue) + R"rawliteral(</span><br>
    <b>Time:</b> <span id='time'>)rawliteral" + String(hourNow) + R"rawliteral(:00</span><br>
    <b>Mode:</b> <span id='mode'>)rawliteral" + String(manualOverride ? "Manual" : "Auto") + R"rawliteral(</span><br>
    <b>Light:</b> <span id='light'>)rawliteral" + String(lightOn ? "ON" : "OFF") + R"rawliteral(</span>
  </div>
  
  <div class='card'>
    <h3>Manual Control</h3>
    <button class='on' onclick="send('on')">ON</button>
    <button class='off' onclick="send('off')">OFF</button>
    <button class='switch' onclick="send('mode')">Switch to )rawliteral" + String(manualOverride ? "Auto" : "Manual") + R"rawliteral(</button>
  </div>

  <div class='card'>
    <h3>Settings</h3>
    <form onsubmit="updateSettings(event)">
      Threshold: <input type='number' id='th' value=')rawliteral" + String(threshold) + R"rawliteral('><br>
      Start Time (HH:MM:SS): <input type='text' id='st' value=')rawliteral" + String(startHour) + ":" + String(startMinute) + ":" + String(startSecond) + R"rawliteral('><br>
      End Time (HH:MM:SS): <input type='text' id='et' value=')rawliteral" + String(endHour) + ":" + String(endMinute) + ":" + String(endSecond) + R"rawliteral('><br>
      <button class='switch' type='submit'>Update</button>
    </form>
  </div>

  </div>
  <script>
  function send(cmd){
    fetch('/'+cmd).then(()=>location.reload());
  }
  function updateSettings(e){
    e.preventDefault();
    const th = document.getElementById('th').value;
    const st = document.getElementById('st').value;
    const et = document.getElementById('et').value;
    fetch(`/set?th=${th}&st=${st}&et=${et}`).then(()=>location.reload());
  }
  </script>
  </body></html>
  )rawliteral";

  server.send(200, "text/html", html);
}

void handleCommand() {
  String cmd = server.uri();
  if (cmd == "/on") { manualOverride = true; manualState = true; }
  else if (cmd == "/off") { manualOverride = true; manualState = false; }
  else if (cmd == "/mode") { manualOverride = !manualOverride; }
  server.sendHeader("Location", "/");
  server.send(303);
}

void handleSet() {
  if (server.hasArg("th")) threshold = server.arg("th").toInt();
  if (server.hasArg("st")) {
    sscanf(server.arg("st").c_str(), "%d:%d:%d", &startHour, &startMinute, &startSecond);
  }
  if (server.hasArg("et")) {
    sscanf(server.arg("et").c_str(), "%d:%d:%d", &endHour, &endMinute, &endSecond);
  }
  server.sendHeader("Location", "/");
  server.send(303);
}

void setup() {
  Serial.begin(115200);
  pinMode(RELAY_PIN, OUTPUT);
  digitalWrite(RELAY_PIN, LOW);

  Serial.println("\nConnecting to Wi-Fi...");
  WiFi.begin(ssid, password);
  while (WiFi.status() != WL_CONNECTED) {
    delay(500);
    Serial.print(".");
  }
  Serial.println("\nWi-Fi connected: " + WiFi.localIP().toString());

  timeClient.begin();
  timeClient.update();

  server.on("/", handleRoot);
  server.on("/on", handleCommand);
  server.on("/off", handleCommand);
  server.on("/mode", handleCommand);
  server.on("/set", handleSet);
  server.begin();
  Serial.println("Web server started!");
}

void loop() {
  server.handleClient();
  timeClient.update();

  int ldrValue = analogRead(LDR_PIN);
  int hourNow = timeClient.getHours();
  bool dark = (ldrValue < threshold);
  bool night = (hourNow >= startHour || hourNow < endHour);
  bool autoState = (dark || night);
  bool lightOn = manualOverride ? manualState : autoState;

  digitalWrite(RELAY_PIN, lightOn ? LOW : HIGH);
  delay(1000);
}

